#[derive(Clone, Debug, Deserialize)]
#[serde(deny_unknown_fields)]
pub struct Weather {
    pub latitude: f64,
    pub cloud_level: u8,
    pub severity: u8,
    #[serde(deserialize_with = "deserialize_polygon")]
    pub polygon: Polygon<f64>,
    pub special_effect_level: u8,
    pub longitude: f64,
    pub id: u64,
    pub rain_level: u8,
    pub fog_level: u8,
    pub wind_direction: u16,
    pub snow_level: u8,
    pub warn_weather: bool,
    pub updated: u8,
    pub gameplay_condition: u8,
    pub wind_level: u8
}

fn deserialize_polygon<'de, D>(data: D) -> Result<Polygon<f64>, D::Error>
where
	D: Deserializer<'de>,
{
    Ok(Polygon::new(LineString::deserialize(data)?, vec![]))
}

